import React from "react";
import ReactEcharts from 'echarts-for-react';
import "./Right.css";


class Rop2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
	
	getROption2 = () => {
		let getStatics = {
             
			legend: {
				orient: 'vertical',
				x: 'left',
				data:['在库文物数量','布展文物数量','外出巡展文物数量','外部文物数量','馆内文物展览数量']
			},
			series: [
				{
					name:'在库文物数量',
					type:'pie',
					radius: ['20%', '70%'],
					avoidLabelOverlap: false,
					label: {
						normal: {
							show: false,
							position: 'center'
						},
					   
					},
					labelLine: {
						normal: {
							show: false
						}
					},
					data:[
						{value:335, name:'直接访问'},
						{value:310, name:'邮件营销'}
					]
				}
			]
        }
        return getStatics;
    }
    render() {
        return (
            <div className="aa">
                <ReactEcharts option={this.getROption2()} style={{ height: "50%" }}></ReactEcharts>
            </div>
        )
    }
}

export default Rop2;
